// src/App.js
import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Sidebar from './components/Sidebar';
import Navbar from './components/Navbar';
import Dashboard from './pages/Dashboard';
import Notes from './pages/Notes';
import Syllabus from './pages/Syllabus';
import Papers from './pages/Papers';
import Universities from './pages/Universities';
import AddPaper from './pages/AddPaper';
import AddSyllabus from './pages/AddSyllabus';
import AddNotes from './pages/AddNotes';
import AddUniversity from './pages/AddUniversity';

function App() {
  return (
    <Router>
      <div className="flex h-screen">
        <Sidebar />
        <div className="flex-1 flex flex-col bg-gray-100">
          <Navbar />
          <main className="p-6 overflow-y-auto">
            <Routes>
              <Route path="/" element={<Dashboard />} />
              <Route path="/notes" element={<Notes />} />
              <Route path="/syllabus" element={<Syllabus />} />
              <Route path="/papers" element={<Papers />} />
              <Route path="/universities" element={<Universities />} />
              <Route path="/add-paper" element={<AddPaper />} />
              <Route path="/add-syllabus" element={<AddSyllabus />} />
              <Route path="/add-notes" element={<AddNotes />} />
              <Route path="/add-university" element={<AddUniversity />} />
            </Routes>
          </main>
        </div>
      </div>
    </Router>
  );
}

export default App;
